Are you able to use a custom domain like: "matrix.example.com"? Yes, absolutely! However you need to set this at host creation time as the homeserver name is "baked in" to all of the events that the homeserver creates. You can set both the homeserver name, e.g. "example.com" (so your Matrix user IDs would be of the form "@foo:example.com") and your (Element) client address, which might be something like "webchat.example.com". However, in order to prove that you own the domain in question you will need to place some JSON / text, .well-known files on the web server for your domain. You will be guided through this process when setting up the custom domain for your server in the setup wizard. Can I customize the Element web login page? Yes, you can modify the look and feel of your client to suit you. Please see our blog article on custom branding for your riot instance, here https://element.io/blog/custom-branding/ , for more details. You will be able to enter the customization preferences from the managed host page of your EMS account - https://ems.element.io/user/hosting . CNAME and .well-known? You need to create a CNAME record with your DNS provider. This need to be: chat.example.com. CNAME yourEMShost.element.io. (please note that proxy must be turned off if you are using CloudFlare) You need to set up a website on your domain example.com. This website needs HTTPS enabled. You need to create two files on the web server. These need to be located at exactly: - https://example.com/.well-known/matrix/client - https://example.com/.well-known/matrix/server You need to enable the CORS header Access-Control-Allow-Origin: * on the web server for the client file. See https://enable-cors.org/ for instructions on how to do this. The client file need to contain: { "m.homeserver": { "base_url": "https://yourEMShost.ems.host" }, "m.identity_server": { "base_url": "https://vector.im" }
} The server file need to contain: { "m.server": "yourEMShost.ems.host:443"
} CNAME doesn't work with CloudFlare? You can use the CNAME with CloudFlare, but you have to change Proxy status to DNS only. Could you expand on "over federation"? If you have federation turned on in your server configuration, you are able to communicate with users registered on other servers (e.g. matrix.org). You are only ever charged for users that are registered on your server, who have been active for more than two days in a month. These users make up your Monthly Active User (MAU) total. Users that are registered on other servers (that you communicate with over federation), guest users and users who are only briefly active on your server are not counted. DNS not resolving This problem was most likely caused by a delay in DNS replication downstream of your DNS servers. Everything seems to be working from my end now. Is everything working as expected for you? How do I change the servers custom domain? You can only set a custom domain name for a server at setup time. This is because the domain name of the server is "baked-in" to all of the events that are generated by the server. So, you would need to deprovision an existing server and create a new one, selecting your custom DNS preferences from the advanced settings section of host setup configuration if you wished to change existing host DNS. How do I delete users when administering the server? You can deactivate users from the admin dashboard for your host, at https://ems.element.io/user/hosting . Select the "Server Admin" tab and then the "User Info." sub-tab. From here you can search for the relevant user and hit the "Deactivate account button". I deleted my host, now my server name is taken and I cannot rebuild This is actually part of a security measure - We generally prevent hosts from returning to the pool after they were initially claimed in order to prevent people from attempting to imitate old servers / users. Contact support from https://ems.element.io/support while signed in to get the hostname released. If I in the future want to migrate from EMS to self-hosted, how? Currently the process for migrating away is manual. However, we hope to have an automated, self-serve system in the not too distant future. For the time being, if you wish to migrate away, please simply email ems-support@element.io (while your EMS server is still up and running) and ask for a snapshot of your Synapse database. We will then generate a snapshot for you and generate a link for you to download the data. You can then use this to restore the database / Synapse instance on your own infrastructure. Is upload of custom yaml supported? Upload of custom (yaml) config is not currently supported for EMS hosts. We are actively working on improving bridging support for EMS hosts and hope that this will be something that you see substantial improvement in over the coming months. Online users are displayed as offline? Unfortunately we are not able to offer user presence as a feature at the moment. This is due to potential performance impact and excess resource usage on hosts when this feature is enabled. The Synapse team are aware of this and it is on their road map to address. However, we do not currently have a timeline for when it will be available again.

