Erstellen Sie zwei statische JSON-Dateien auf Ihrer Webseite. Diese müssen unter den folgenden Pfaden öffentlich aus dem Internet erreichbar sein. https://matrix.org/.well-known/matrix/client https://matrix.org/.well-known/matrix/serve Statt matrix.org, sind hier die entsprechenden Pfade auf Ihrer Domain gemeint. Ist der Ordner .well-known auf Ihrem Webspace nicht vorhanden, erstellen Sie ihn. Manche Programme blenden Ordner aus, wenn sie mit einem Punkt starten. Er könnte also schon existieren. Erstellen Sie darin einen Ordner matrix. Die JSON-Dateien client und server dürfen keine Dateiendung haben und müssen die folgenden Inhalte haben. Ersetzen Sie “unternehmen” mit Ihrem EMS-Hostnamen. Diesen finden Sie auf https://ems.element.io/user/hosting vor “.ems.host”, z.B. “unternehmen.ems.host”. Wurde Ihr Server vor dem Sommer 2020 angelegt, hat er vermutlich die Endung “.modular.im”. /.well-known/matrix/client { "m.homeserver": { "base_url": "https://unternehmen.ems.host" }, "m.identity_server": { "base_url": "https://vector.im" }
} /.well-known/matrix/server { "m.server": "unternehmen.ems.host:443"
} Ersetzen Sie in beiden Beispielen unternehmen.ems.host durch Ihre EMS-Serveradresse
